import React, { Component } from "react";
import { Grid, Table} from "semantic-ui-react";



class Scores extends Component {
render(){
return (
<div>


{/* SCORES */}
<Grid.Row>
 <Grid.Column width={8}>
  <Table celled>
   <Table.Header>
     <Table.Row>
       <Table.HeaderCell colSpan="2">Review Scores</Table.HeaderCell>
     </Table.Row>
   </Table.Header>

   <Table.Body>
       {
           wineObjKeys.map(key => 
                   wine[key] !== '' && key === 'WineSpectator' && key === 'Parker' && key === 'W_S' && key === 'Vinous' && key === 'Decanter' && key === 'Guide_Hachette' && key === 'Wine_Enthusiast' && key === 'Jancis_Robinson' && key === 'Gilbert_Gaillard' && key === 'Falstaff' && <Table.Row key={key}>
                       <Table.Cell>{this.removeUnderscores(key)}</Table.Cell>
                       <Table.Cell>{wine[key]}</Table.Cell>
                   </Table.Row>
           )
       }
   </Table.Body>
  </Table>
 </Grid.Column>
</Grid.Row>
</div>
);
}
}
export default Scores;
